import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="bg-blue-900 text-white p-4 flex flex-col md:flex-row justify-between items-center shadow-md">
      <h1 className="text-xl font-bold mb-2 md:mb-0">Juttuka Prasad</h1>
      <ul className="flex flex-wrap justify-center gap-4 text-sm md:text-base">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/about">About</Link></li>
        <li><Link to="/education">Education</Link></li>
        <li><Link to="/skills">Skills</Link></li>
        <li><Link to="/projects">Projects</Link></li>
        <li><Link to="/gallery">Gallery</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
